Actionscript.script:
if (_parent._name == _root.控制目标 && _parent.状态 === "空手站立")
{
	_parent.读取当前飞行状态();
}
//_parent._rotation = 0;   
if (_parent.性别 === "女")
{
	gotoAndPlay(_parent.格斗架势 ? "格斗架势-女" : "站立-女");
}else{
	gotoAndPlay(_parent.格斗架势 ? "格斗架势-男" : "站立-男");
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
